import crypto from "crypto";
import { GetServerSidePropsContext } from "next";
import Image from "next/image";

import { getSession } from "@lib/auth";
import prisma from "@lib/prisma";
import { defaultAvatarSrc } from "@lib/profile";
import { inferSSRProps } from "@lib/types/inferSSRProps";

const getAvatar = async (body: { avatar: string }) => {
  const response = await fetch("/api/user/avatar", {
    method: "POST",
    body: JSON.stringify(body),
    headers: {
      "Content-Type": "application/json",
    },
  });
  console.log("response =>", response);
};
type Props = inferSSRProps<typeof getServerSideProps>;

export default function handler(props: { user: Props["user"] }) {
  // const id = req.query.id;
  const d =
    "data:image/png;base64,";

  const e = props.user.avatar || defaultAvatarSrc({ md5: props.user.emailMd5 });
  // Add support for empty props.user.avatar (gravatar)

  const body = {
    avatar: e,
    gravatar: !props.user.avatar,
  };
  getAvatar(body);

  return (
    <>
      <Image src={d} height={250} width={250} />
    </>
  );
}

export async function getServerSideProps(context: GetServerSidePropsContext) {
  const session = await getSession(context);

  if (!session?.user?.id) {
    return { redirect: { permanent: false, destination: "/auth/login" } };
  }

  const user = await prisma.user.findUnique({
    where: {
      id: session.user.id,
    },
    select: {
      avatar: true,
      email: true,
    },
  });

  if (!user) {
    throw new Error("User seems logged in but cannot be found in the db");
  }

  return {
    props: {
      user: {
        ...user,
        emailMd5: crypto.createHash("md5").update(user.email).digest("hex"),
      },
    },
  };
}
